!       calculation of production and loss terms for diagnostics
!!
!!**  METHOD
!!    ------
!!      The terms of temporal derivative of the chemical species,
!!    written as:
!!    d/dt PCONC = CH_FCN = PPROD - PCONC*PLOSS,
!!    are calculated for diagnostic purposes.
!!
!!    REFERENCE
!!    ---------
!!    none
!!
!!    AUTHOR
!!    ------
!!    Karsten Suhre (LA)
!!
!!    MODIFICATIONS
!!    -------------
!!    Original 26/07/96
!!    Modified 05/05/98: Vectorization (Vincent Crassier & KS)
!!    Modified 31/10/03: New interface for better MesoNH compilation (D. Gazen)
!!
!!----------------------------------------------------------------------
!!
!!    EXTERNAL
!!    --------
!!    none
!!
!!    IMPLICIT ARGUMENTS
!!    ------------------
USE MODD_CH_M9_SCHEME
!!
!!    EXPLICIT ARGUMENTS
!!    ------------------
IMPLICIT NONE
REAL,    INTENT(IN)                      :: PTIME
INTEGER, INTENT(IN)                      :: KVECNPT
INTEGER, INTENT(IN)                      :: KEQ
REAL,    INTENT(IN),  DIMENSION(KVECNPT,KEQ)     :: PCONC
REAL,    INTENT(OUT), DIMENSION(KVECNPT,KEQ)     :: PPROD, PLOSS
INTEGER, INTENT(IN)                          :: KMI
TYPE(CCSTYPE), POINTER         :: TPK
TPK=>TACCS(KMI)
! /BEGIN_CODE/
TPK%OSD = (  +TPK%K016*PCONC(:,JP_O3)  ) / &
  (  +TPK%K017*TPK%H2O+TPK%K018A*TPK%N2(:)+TPK%K018B*TPK%O2(:) ) 
!
TPK%O = (  +TPK%K001*PCONC(:,JP_NO2)+TPK%K014*PCONC(:,JP_NO3)+TPK%&
&K015*PCONC(:,JP_O3)+TPK%K018A*TPK%OSD*TPK%N2(:)+TPK%K018B*TPK%OSD*TPK%O2(:)  ) / &
(  +TPK%K002*TPK%O2(:)+TPK%K003*PCONC(:,JP_NO2)+TPK%K004*PCONC(:,JP_NO2)+TPK%K034*&
PCONC(:,JP_O3)+TPK%K038*PCONC(:,JP_NO)+TPK%K052*PCONC(:,JP_ETHE)+&
&TPK%K057*PCONC(:,JP_OLEL)+TPK%K067*PCONC(:,JP_ISOP)+TPK%K077*PCONC(:,&
&JP_OLEH)+TPK%K087*PCONC(:,JP_BIOL)+TPK%K091*PCONC(:,JP_BIOH)+TPK%K283&
&*PCONC(:,JP_MVK)+TPK%K284*PCONC(:,JP_MCR)  ) 
!
TPK%RO225 = (  TPK%K085*PCONC(:,JP_BIOL)*PCONC(:,JP_NO3)  ) / &
( +TPK%K201*PCONC(:,JP_NO)+TPK%K202*PCONC(:,JP_RO2T)+TPK%K203*PCONC(:,JP_HO2))
!
TPK%RO228 = (  TPK%K089*PCONC(:,JP_BIOH)*PCONC(:,JP_NO3)  ) / &
( +TPK%K210*PCONC(:,JP_NO)+TPK%K211*PCONC(:,JP_RO2T)+TPK%K212*PCONC(:,JP_HO2))

!
TPK%RO253 = (  +0.41*TPK%K282*PCONC(:,JP_MCR)*PCONC(:,JP_O3)  ) / &
(  +TPK%K297*PCONC(:,JP_NO)+TPK%K298*PCONC(:,JP_HO2)+TPK%K299*PCONC(&
&:,JP_RO2T)  ) 
!
TPK%RO254 = (  +TPK%K140*PCONC(:,JP_PAN6)+TPK%K297*TPK%RO253*&
&PCONC(:,JP_NO)+TPK%K298*TPK%RO253*PCONC(:,JP_HO2)+TPK%K299*&
&TPK%RO253*PCONC(:,JP_RO2T)  ) / &
(  +TPK%K131*PCONC(:,JP_NO2)+TPK%K300*PCONC(:,JP_NO)+TPK%K301*PCONC(&
&:,JP_HO2)+TPK%K302*PCONC(:,JP_RO2T)  ) 
!
TPK%RO213 = (  +0.271*TPK%K066*PCONC(:,JP_ISOP)*PCONC(:,JP_O3)  ) / &
(  +TPK%K162*PCONC(:,JP_NO)+TPK%K163*PCONC(:,JP_RO2T)+TPK%K164*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO239 = (  +TPK%K137*PCONC(:,JP_PAN3)+TPK%K162*TPK%RO213*&
&PCONC(:,JP_NO)+TPK%K163*TPK%RO213*PCONC(:,JP_RO2T)+TPK%K164*TPK%RO213*PCONC(:,JP_HO2)  ) / &
(  +TPK%K128*PCONC(:,JP_NO2)+TPK%K165*PCONC(:,JP_NO)+TPK%K166*PCONC(&
&:,JP_HO2)+TPK%K167*PCONC(:,JP_RO2T)  ) 
!
TPK%RO248 = (  +TPK%K141*PCONC(:,JP_PAN4)+TPK%K274*PCONC(:,JP_MGLY)*P&
&CONC(:,JP_OH)+TPK%K278*PCONC(:,JP_MGLY)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K129*PCONC(:,JP_NO2)+TPK%K277*PCONC(:,JP_NO)+TPK%K279*PCONC(&
&:,JP_HO2)+TPK%K280*PCONC(:,JP_RO2T)  ) 
!
TPK%RO249 = (  +TPK%K272*PCONC(:,JP_MVK)*PCONC(:,JP_OH)  ) / &
(  +TPK%K285*PCONC(:,JP_NO)+TPK%K286*PCONC(:,JP_RO2T)+TPK%K287*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO250 = (  +0.3750353*TPK%K139*PCONC(:,JP_APAN)+TPK%CF46*TPK%K2&
&73*PCONC(:,JP_MCR)*PCONC(:,JP_OH)+TPK%CF46*TPK%K275*PCONC(:,JP_MCR)*PCONC&
&(:,JP_NO3)  ) / &
(  +TPK%K130*PCONC(:,JP_NO2)+TPK%K288*PCONC(:,JP_NO)+TPK%K289*PCONC(&
&:,JP_HO2)+TPK%K290*PCONC(:,JP_RO2T)  ) 
!
TPK%RO214 = (  +0.095*TPK%K066*PCONC(:,JP_ISOP)*PCONC(:,JP_O3)+TPK%K1&
&65*TPK%RO239*PCONC(:,JP_NO)+TPK%K167*TPK%RO239*PCONC(:,JP_R&
&O2T)+TPK%K288*TPK%RO250*PCONC(:,JP_NO)+TPK%K290*TPK%RO250&
&*PCONC(:,JP_RO2T)  ) / &
(  +TPK%K168*PCONC(:,JP_NO)+TPK%K169*PCONC(:,JP_RO2T)+TPK%K170*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO251 = (  +TPK%CF47*TPK%K273*PCONC(:,JP_MCR)*PCONC(:,JP_OH)  ) / &
(  +TPK%K291*PCONC(:,JP_NO)+TPK%K292*PCONC(:,JP_HO2)+TPK%K293*PCONC(&
&:,JP_RO2T)  ) 
!
TPK%RO252 = (  +TPK%CF47*TPK%K275*PCONC(:,JP_MCR)*PCONC(:,JP_NO3)  ) /&
(  +TPK%K294*PCONC(:,JP_NO)+TPK%K295*PCONC(:,JP_HO2)+TPK%K296*PCONC(&
&:,JP_RO2T)  ) 
!
TPK%RO258 = (  +TPK%K138*PCONC(:,JP_PN10)+TPK%K305*PCONC(:,JP_RP16)*P&
&CONC(:,JP_OH)+TPK%K338*PCONC(:,JP_RP16)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K134*PCONC(:,JP_NO2)+TPK%K340*PCONC(:,JP_NO)+TPK%K341*PCONC(&
&:,JP_HO2)+TPK%K342*PCONC(:,JP_RO2T)  ) 
!
TPK%RO255 = (  +TPK%K304*PCONC(:,JP_RPR1)*PCONC(:,JP_OH)+TPK%K307*PCO&
&NC(:,JP_RPR1)*PCONC(:,JP_NO3)+TPK%K343*PCONC(:,JP_PAN7)  ) / &
(  +TPK%K132*PCONC(:,JP_NO2)+TPK%K309*PCONC(:,JP_NO)+TPK%K310*PCONC(&
&:,JP_HO2)+TPK%K311*PCONC(:,JP_RO2T)  ) 
!
TPK%RO256 = (  +TPK%K312*PCONC(:,JP_RPR3)*PCONC(:,JP_OH)+TPK%K313*PCO&
&NC(:,JP_RPR3)*PCONC(:,JP_NO3)+TPK%K317*PCONC(:,JP_PAN8)  ) / &
(  +TPK%K315*PCONC(:,JP_NO)+TPK%K316*PCONC(:,JP_NO2)+TPK%K318*PCONC(&
&:,JP_HO2)+TPK%K319*PCONC(:,JP_RO2T)  ) 
!
TPK%RO257 = (  +0.6249651*TPK%K139*PCONC(:,JP_APAN)+TPK%K324*PCONC(:,&
&JP_RPR8)*PCONC(:,JP_OH)+TPK%K327*PCONC(:,JP_RPR8)*PCONC(:,JP_NO3)+TPK%K3&
&30*PCONC(:,JP_RPR8)  ) / &
(  +TPK%K133*PCONC(:,JP_NO2)+TPK%K331*PCONC(:,JP_NO)+TPK%K332*PCONC(&
&:,JP_HO2)+TPK%K333*PCONC(:,JP_RO2T)  ) 
!
TPK%RO29 = (  +0.66*TPK%K064*PCONC(:,JP_ISOP)*PCONC(:,JP_OH)+TPK%K329&
&*PCONC(:,JP_RPR8)+TPK%K331*TPK%RO257*PCONC(:,JP_NO)+TPK%K333*TPK%RO257*&
PCONC(:,JP_RO2T)  ) / &
(  +TPK%K150*PCONC(:,JP_NO)+TPK%K151*PCONC(:,JP_RO2T)+TPK%K152*PCONC&
&(:,JP_HO2)  ) 
!
!avoid division by zero in prodloss
WHERE (PCONC(:,JP_NO2)>0.)
  TPK%RAD1 = (  +TPK%K072*PCONC(:,JP_AROO)*PCONC(:,JP_NO3)  ) / &
  (  +TPK%K103*PCONC(:,JP_NO2)  ) 
!
  TPK%RAD8 = (  +TPK%K320*PCONC(:,JP_RPR4)*PCONC(:,JP_NO3)  ) / &
  (  +TPK%K321*PCONC(:,JP_NO2)  ) 
ELSEWHERE
  TPK%RAD1 = 0.
  TPK%RAD8 = 0.
ENDWHERE
!
TPK%RAD2 = (  +0.74*TPK%K073*PCONC(:,JP_AROO)*PCONC(:,JP_OH)  ) / &
(  +TPK%K097+TPK%K104*PCONC(:,JP_NO2)  ) 
!
TPK%RAD3 = (  +0.74*TPK%K079*PCONC(:,JP_AROL)*PCONC(:,JP_OH)  ) / &
(  +TPK%K098+TPK%K105*PCONC(:,JP_NO2)  ) 
!
TPK%RAD4 = (  +0.84*TPK%K080*PCONC(:,JP_AROH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K099+TPK%K106*PCONC(:,JP_NO2)  ) 
!
TPK%RAD5 = (  +TPK%CF40*TPK%K082*PCONC(:,JP_ARAL)*PCONC(:,JP_OH)  ) / &
(  +TPK%K100+TPK%K107*PCONC(:,JP_NO2)  ) 
!
TPK%RAD6 = (  +0.74*TPK%K083*PCONC(:,JP_ARAC)*PCONC(:,JP_OH)  ) / &
(  +TPK%K101+TPK%K108*PCONC(:,JP_NO2)  ) 
!
TPK%RAD7 = (  +0.74*TPK%K092*PCONC(:,JP_PAH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K102+TPK%K109*PCONC(:,JP_NO2)  ) 
!
TPK%RO22 = (  +TPK%K049*PCONC(:,JP_ETHE)*PCONC(:,JP_OH)+TPK%CF2*TPK&
&%K053*PCONC(:,JP_ETOH)*PCONC(:,JP_OH)+TPK%K054*PCONC(:,JP_OLEL)*PCONC(:,JP_&
&OH)+TPK%K069*PCONC(:,JP_ALCH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K113*PCONC(:,JP_NO)+TPK%K114*PCONC(:,JP_RO2T)+TPK%K115*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO23 = (  +TPK%K050*PCONC(:,JP_ETHE)*PCONC(:,JP_NO3)+TPK%K055*PCO&
&NC(:,JP_OLEL)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K116*PCONC(:,JP_NO)+TPK%K117*PCONC(:,JP_RO2T)+TPK%K118*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO24 = (  +0.4*TPK%K052*PCONC(:,JP_ETHE)*TPK%O+0.1*TPK%K0&
&57*PCONC(:,JP_OLEL)*TPK%O+0.1*TPK%K077*PCONC(:,JP_OLEH)*&
&TPK%O+0.15*TPK%K283*PCONC(:,JP_MVK)*TPK%O  ) / &
(  +TPK%K119*PCONC(:,JP_NO)+TPK%K120*PCONC(:,JP_RO2T)+TPK%K121*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO26 = (  +TPK%K060*PCONC(:,JP_ALD2)*PCONC(:,JP_OH)+TPK%K061*PCON&
&C(:,JP_ALD2)*PCONC(:,JP_NO3)+TPK%K135*PCONC(:,JP_PAN1)  ) / &
(  +TPK%K125*PCONC(:,JP_NO)+TPK%K126*PCONC(:,JP_NO2)+TPK%K142*PCONC(&
&:,JP_HO2)+TPK%K143*PCONC(:,JP_RO2T)  ) 
!
TPK%RO27 = (  +TPK%K062*PCONC(:,JP_KETL)*PCONC(:,JP_OH)+TPK%CF8*TPK&
&%K168*TPK%RO214*PCONC(:,JP_NO)+TPK%K169*TPK%RO214*PCONC(:,J&
&P_RO2T)+TPK%K170*TPK%RO214*PCONC(:,JP_HO2)+0.15*TPK%K284*PCONC(:&
&,JP_MCR)*TPK%O  ) / &
(  +TPK%K144*PCONC(:,JP_NO)+TPK%K145*PCONC(:,JP_RO2T)+TPK%K146*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO210 = (  +0.34*TPK%K064*PCONC(:,JP_ISOP)*PCONC(:,JP_OH)  ) / &
(  +TPK%K153*PCONC(:,JP_NO)+TPK%K154*PCONC(:,JP_RO2T)+TPK%K155*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO211 = (  +0.66*TPK%K065*PCONC(:,JP_ISOP)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K156*PCONC(:,JP_NO)+TPK%K157*PCONC(:,JP_RO2T)+TPK%K158*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO212 = (  +0.34*TPK%K065*PCONC(:,JP_ISOP)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K159*PCONC(:,JP_NO)+TPK%K160*PCONC(:,JP_RO2T)+TPK%K161*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO215 = (  +TPK%K068*PCONC(:,JP_MTBE)*PCONC(:,JP_OH)  ) / &
(  +TPK%K171*PCONC(:,JP_NO)+TPK%K172*PCONC(:,JP_RO2T)+TPK%K173*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO216 = (  +TPK%K070*PCONC(:,JP_KETH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K174*PCONC(:,JP_NO)+TPK%K175*PCONC(:,JP_RO2T)+TPK%K176*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO217 = (  +0.1*TPK%K073*PCONC(:,JP_AROO)*PCONC(:,JP_OH)  ) / &
(  +TPK%K177*PCONC(:,JP_NO)+TPK%K178*PCONC(:,JP_RO2T)+TPK%K179*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO220 = (  +0.28*TPK%K076*PCONC(:,JP_OLEH)*PCONC(:,JP_O3)+0.1*TPK&
&%K077*PCONC(:,JP_OLEH)*TPK%O+TPK%K078*PCONC(:,JP_ALKM)*PCONC(:,JP_O&
&H)+TPK%K308*PCONC(:,JP_RPR1)+TPK%K309*TPK%RO255*PCONC(:,JP_NO)+T&
&PK%K311*TPK%RO255*PCONC(:,JP_RO2T)  ) / &
(  +TPK%K186*PCONC(:,JP_NO)+TPK%K187*PCONC(:,JP_RO2T)+TPK%K188*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO218 = (  +TPK%K074*PCONC(:,JP_OLEH)*PCONC(:,JP_OH)+TPK%CF18*TPK%K186*&
TPK%RO220*PCONC(:,JP_NO)+TPK%K187*TPK%RO220*PCONC(:&
&,JP_RO2T)+TPK%K188*TPK%RO220*PCONC(:,JP_HO2)  ) / &
(  +TPK%K180*PCONC(:,JP_NO)+TPK%K181*PCONC(:,JP_RO2T)+TPK%K182*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO219 = (  +TPK%K075*PCONC(:,JP_OLEH)*PCONC(:,JP_NO3)  ) / &
(  +TPK%K183*PCONC(:,JP_NO)+TPK%K184*PCONC(:,JP_RO2T)+TPK%K185*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO221 = (  +0.1*TPK%K079*PCONC(:,JP_AROL)*PCONC(:,JP_OH)  ) / &
(  +TPK%K189*PCONC(:,JP_NO)+TPK%K190*PCONC(:,JP_RO2T)+TPK%K191*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO222 = (  +TPK%CF45*TPK%K082*PCONC(:,JP_ARAL)*PCONC(:,JP_OH)  ) /&
& &
(  +TPK%K192*PCONC(:,JP_NO)+TPK%K193*PCONC(:,JP_RO2T)+TPK%K194*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO223 = (  +0.1*TPK%K083*PCONC(:,JP_ARAC)*PCONC(:,JP_OH)  ) / &
(  +TPK%K195*PCONC(:,JP_NO)+TPK%K196*PCONC(:,JP_RO2T)+TPK%K197*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO224 = (  +TPK%K084*PCONC(:,JP_BIOL)*PCONC(:,JP_OH)  ) / &
(  +TPK%K198*PCONC(:,JP_NO)+TPK%K199*PCONC(:,JP_RO2T)+TPK%K200*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO226 = (  +0.445*TPK%K086*PCONC(:,JP_BIOL)*PCONC(:,JP_O3)  ) / &
(  +TPK%K204*PCONC(:,JP_NO)+TPK%K205*PCONC(:,JP_RO2T)+TPK%K206*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO227 = (  +TPK%K088*PCONC(:,JP_BIOH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K207*PCONC(:,JP_NO)+TPK%K208*PCONC(:,JP_RO2T)+TPK%K209*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO229 = (  +0.445*TPK%K090*PCONC(:,JP_BIOH)*PCONC(:,JP_O3)  ) / &
(  +TPK%K213*PCONC(:,JP_NO)+TPK%K214*PCONC(:,JP_RO2T)+TPK%K215*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO230 = (  +0.445*TPK%K090*PCONC(:,JP_BIOH)*PCONC(:,JP_O3)  ) / &
(  +TPK%K219*PCONC(:,JP_RO2T)+TPK%K220*PCONC(:,JP_HO2)+TPK%K344*PCON&
&C(:,JP_NO)  ) 
!
TPK%RO231 = (  +0.1*TPK%K092*PCONC(:,JP_PAH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K221*PCONC(:,JP_NO)+TPK%K222*PCONC(:,JP_RO2T)+TPK%K223*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO232 = (  +TPK%K093*PCONC(:,JP_ALKH)*PCONC(:,JP_OH)  ) / &
(  +TPK%K224*PCONC(:,JP_NO)+TPK%K225*PCONC(:,JP_RO2T)+TPK%K226*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO233 = (  +TPK%K097*TPK%RAD2  ) / &
(  +TPK%K230+TPK%K231*PCONC(:,JP_NO)+TPK%K232*PCONC(:,JP_RO2T)+TPK%K233*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO234 = (  +TPK%K098*TPK%RAD3  ) / &
(  +TPK%K237+TPK%K238*PCONC(:,JP_NO)+TPK%K239*PCONC(:,JP_RO2T)+TPK%K240*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO235 = (  +TPK%K099*TPK%RAD4  ) / &
(  +TPK%K244+TPK%K245*PCONC(:,JP_NO)+TPK%K246*PCONC(:,JP_RO2T)+TPK%K247*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO236 = (  +TPK%K100*TPK%RAD5  ) / &
(  +TPK%K251+TPK%K252*PCONC(:,JP_NO)+TPK%K253*PCONC(:,JP_RO2T)+TPK%K254*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO237 = (  +TPK%K101*TPK%RAD6  ) / &
(  +TPK%K258+TPK%K259*PCONC(:,JP_NO)+TPK%K260*PCONC(:,JP_RO2T)+TPK%K261*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO238 = (  +TPK%K102*TPK%RAD7  ) / &
(  +TPK%K265+TPK%K266*PCONC(:,JP_NO)+TPK%K267*PCONC(:,JP_RO2T)+TPK%K268*&
PCONC(:,JP_HO2)  ) 
!
TPK%RO240 = (  +TPK%CF30*TPK%K213*TPK%RO229*PCONC(:,JP_NO)+TPK%K214*&
TPK%RO229*PCONC(:,JP_RO2T)+TPK%K215*TPK%RO229*PCON&
&C(:,JP_HO2)  ) / &
(  +TPK%K216*PCONC(:,JP_NO)+TPK%K217*PCONC(:,JP_RO2T)+TPK%K218*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO241 = (  +TPK%CF34*TPK%K224*TPK%RO232*PCONC(:,JP_NO)+TPK%K225*&
TPK%RO232*PCONC(:,JP_RO2T)+TPK%K226*TPK%RO232*PCON&
&C(:,JP_HO2)  ) / &
(  +TPK%K227*PCONC(:,JP_NO)+TPK%K228*PCONC(:,JP_RO2T)+TPK%K229*PCONC&
&(:,JP_HO2)  ) 
!
TPK%RO242 = (  +TPK%K230*TPK%RO233  ) / &
(  +TPK%K234*PCONC(:,JP_NO)+TPK%K235*PCONC(:,JP_RO2T)+TPK%K236*PCONC&
&(:,JP_HO2)  ) 
!
