      SUBROUTINE CH_SPARSE_AQ
!!    #######################
!!
!!*** *MODD_CH_SPARSE*
!!
!!    PURPOSE
!!    -------
!       calculation of the non-zero matrix elements in the Jacobian
!!
!!**  METHOD
!!    ------
!!      A 2D array KSPARSE of DIMESNSION(2,*) is returned, containing 
!!    the indices of the non-zero matrix elements in the Jacobian.
!!
!!    REFERENCE
!!    ---------
!!    none
!!
!!    AUTHOR
!!    ------
!!    Karsten Suhre (LA)
!!
!!    MODIFICATIONS
!!    -------------
!!    Original 26/07/96
!!    Modified 05/05/98: Vectorization (Vincent Crassier & KS)
!!
!!----------------------------------------------------------------------
!!
!!    EXTERNAL
!!    --------
!!    none
!!
!!    IMPLICIT ARGUMENTS
!!    ------------------
!!    none
!!
!!    EXPLICIT ARGUMENTS
!!    ------------------
IMPLICIT NONE
!!
!!    LOCAL VARIABLES
!!    ---------------
!!    none
!!----------------------------------------------------------------------
!!
!!    EXECUTABLE STATEMENTS
!!    ---------------------
! check if output array is large enough
IF (KSPARSEDIM.LT.1108) THEN
  STOP 'CH_SPARSE ERROR: array KSPARSE is too small!'
END IF
!NO/NO
 KSPARSE(1, 1)=1
 KSPARSE(2, 1)=1
!NO/NO2
 KSPARSE(1, 2)=1
 KSPARSE(2, 2)=2
!NO/O3
 KSPARSE(1, 3)=1
 KSPARSE(2, 3)=3
!NO/HONO
 KSPARSE(1, 4)=1
 KSPARSE(2, 4)=4
!NO/NO3
 KSPARSE(1, 5)=1
 KSPARSE(2, 5)=8
!NO/HO2
 KSPARSE(1, 6)=1
 KSPARSE(2, 6)=10
!NO/OH
 KSPARSE(1, 7)=1
 KSPARSE(2, 7)=15
!NO/RO2T
 KSPARSE(1, 8)=1
 KSPARSE(2, 8)=85
!NO/RO21
 KSPARSE(1, 9)=1
 KSPARSE(2, 9)=86
!NO/RO25
